import "./App.css";
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element={<BookList />} />
        <Route path="/search" element={<BookSearch />} />
      </Routes>
    </div>
  );
}

const BookList = () => {};
const BookSearch = () => {};

export default App;
